import {
    env,
} from "cloudflare:test";
import {describe, it, expect} from "vitest";
import {GeminiService} from "../../../src/common/services/gemini.service"
import * as yup from 'yup';
import {luxonDateTimeSchema} from "../../../src/common/schemas/luxon.schema";
import {DateTime} from "luxon";
import {LONG_RUNNING_TEST_TIMEOUT} from "../../constants";

describe("textToText", () => {
    it("should respond with text 'YES'", async () => {
        // @ts-ignore
        const service = new GeminiService(env.GEMINI_KEY);

        const result = await service.textToText("Test prompt, only respond with one word: 'YES'");

        expect(result.text).toBe("YES");
        console.log(result.text)
    });
});

describe("textToJson", () => {
    it("should respond with object with prop text that has value 'YES'", async () => {
        // @ts-ignore
        const service = new GeminiService(env.GEMINI_KEY);

        interface Test {
            text: string;
        }

        const testSchema = yup.object({
            text: yup.string().required(),
        });


        const result = await service.textToJson<Test>("Test prompt, only with text: 'YES'", testSchema);

        expect(result.json).toStrictEqual({text: "YES"});
        console.log(result.json)
    });
});

describe("imageToText", () => {
    it("should respond with text 'Cat'", async () => {
        const base64 = "";
        // @ts-ignore
        const service = new GeminiService(env.GEMINI_KEY);

        const result = await service.imageToText("Describe the following image in only one word, it should be the most common and simple word regarding this image", {
            base64,
        });

        expect(result.text).toBe("Cat");
        console.log(result.text)
    }, {timeout: LONG_RUNNING_TEST_TIMEOUT});
});

describe("imageToJson", () => {
    it("should respond with object describing image of cat", async () => {
        const base64 = "";
        // @ts-ignore
        const service = new GeminiService(env.GEMINI_KEY);

        interface Cat {
            name: string,
            width: number,
            height: number,
            identifier?: string,
            species: string,
            breed: string,
            color: string,
            age: number,
            date: DateTime,
            stats: {
                attack: number,
                defense: number,
                speed: number,
            }
        }

        const catSchema = yup.object({
            name: yup.string().required(),
            width: yup.number().required(),
            height: yup.number().required(),
            identifier: yup.string().optional(),
            species: yup.string().required(),
            breed: yup.string().required(),
            color: yup.string().required(),
            age: yup.number().required(),
            date: luxonDateTimeSchema.required(),
            stats: yup.object({
                attack: yup.number().required(),
                defense: yup.number().required(),
                speed: yup.number().required(),
            }).required(),
        });

        const result = await service.imageToJson<Cat>("Describe the following image to the best of your ability", catSchema, {
            base64,
        });

        expect(result.json).not.toBeNull();
        console.log(result.json)
    }, {timeout: LONG_RUNNING_TEST_TIMEOUT});
});